import React from 'react';
import Navbar from './components/Navbar';
import SlidingInterval from './components/CarouselComponent';
import Button from "./components/Button"

function App() {
  return (
    <div>
      <Navbar />
      <section id="section1">
      <SlidingInterval />

      </section>
      <section id="section2">
        {/* Content for Section 2 */}
        <h2>Section 2</h2>
        <Button/>
      </section>

    </div>
  );
}

export default App;
